    false,nt"url": null,nt"notes": "This Narrative Report for Malheur National
    Wildlife Refuge summarizes refuge activities from September through December of
    1961.  The report begins with general information about the yearu2019s weather and
    habitat conditions.  Wildlife- including migratory birds, upland game birds, big
    game animals, fur animals, predators, rodents, other mammals, predaceous birds,
    fish, and disease- is also covered.  The report includes a refuge development and
    maintenance section which discusses physical developments, plantings, collections
    and receipts, control of vegetation, and fires.  Resource management is outlined;
    grazing, haying, and fur harvesting are the primary economic uses of the refuge.
     A progress report on field investigations and applied research is also included.
     The public relations section of the report discusses recreational uses of the
    refuge, refuge visitors, refuge participation, hunting, fishing, safety, and violations.
     Finally, items of interest, photographs, and N-R forms are provided.",nt"license_title":
